	if not (chp or vol) or 'preview' in item['title'].lower():
		return None
	tags = item['tags']
	title = item['title']
	src = item['srcname']
	postfix = ''
	if src == 'XCrossJ' and 'Cross Gun' in item['tags']:
		return buildReleaseMessage(item, 'Cross Gun', vol, chp, frag=frag, postfix=postfix, tl_type='oel')
